function List() {
    const reviewer = ['reviewer1:This is good', 'reviewer2:This is very good']
    const reviewers = reviewer.map((r, index) => <li key = {index}>{r}</li>);
    const review = ['This is good', 'reviewer2:This is very good']
    const reviews = reviewer.map((r, index) => <li key = {index}>{r}</li>);
    return (<div>
        <ul>{reviewers}</ul>
    </div>);
}
export default List;
